class TestWebScraper(TestCase):

    def setUp(self):
        self.web_scraper = WebScraper()
        self.requestsMock = Mock()
        self.web_scraper.requests = self.requestsMock

    def test_find_arrest_ok(self):
        ref = 12345
        response_mock = Mock()
        response_mock.status_code = 200
        response_mock.content = PDF
        response_mock.headers = {'Content-Type': 'application/pdf'}
        self.requestsMock.get.return_value = response_mock
        result = self.web_scraper.find_arrest(ref)
        self.assertEqual(PDF, result)

    def test_find_arrest_not_found(self):
        ref = 123456
        response_mock = Mock()
        response_mock.status_code = 200
        response_mock.content = ARREST_NOT_FOUND.format(ref=ref)
        response_mock.headers = {'Content-Type': 'text/html'}
        self.requestsMock.get.return_value = response_mock
        with self.assertRaises(Exception) as context:
            self.web_scraper.find_arrest(ref)
        self.assertEqual('Arrest \'{ref}\' not found Content-Type \'text/html\' : <html><head><title>Raadvst-Consetat</title><body>Het arrest <b>{ref}</b> is niet toegankelijk, of bestaat niet.</body></html>'.format(ref=ref),
                         str(context.exception))

    def test_find_arrest_error(self):
        ref = 12345
        response_mock = Mock()
        response_mock.status_code = 404
        self.requestsMock.get.return_value = response_mock
        with self.assertRaises(Exception) as context:
            self.web_scraper.find_arrest(ref)
        self.assertEqual('Code error 404 on page http://www.conseildetat.be/arr.php?nr={ref}'.format(ref=ref),
                         str(context.exception))

    def test_find_public_procurements_refs_not_found(self):
        response_mock = Mock()
        response_mock.status_code = 404
        response_mock.content = HTML_CONTENT_NOT_OK
        self.requestsMock.get.return_value = response_mock
        with self.assertRaises(Exception) as context:
            self.web_scraper.find_public_procurements_refs_month("02")
        self.assertEqual('Code error 404 on page http://www.conseildetat.be/?lang=fr&page=lastmonth_02',
                         str(context.exception))
        self.requestsMock.get.assert_called_with('http://www.conseildetat.be/?lang=fr&page=lastmonth_02')

    def test_find_public_procurements_refs_section_missing(self):
        response_mock = Mock()
        response_mock.status_code = 200
        response_mock.content = HTML_CONTENT_NOT_OK
        self.requestsMock.get.return_value = response_mock
        with self.assertRaises(MissingSectionException) as context:
            self.web_scraper.find_public_procurements_refs_month("02")
        self.assertEqual(
            'Section "Marchés et travaux publics" not found in http://www.conseildetat.be/?lang=fr&page=lastmonth_02',
            str(context.exception))
        self.requestsMock.get.assert_called_with('http://www.conseildetat.be/?lang=fr&page=lastmonth_02')

    def test_find_public_procurements_refs(self):
        response_mock = Mock()
        response_mock.status_code = 200
        response_mock.content = HTML_CONTENT_OK
        self.requestsMock.get.return_value = response_mock
        ref_list = self.web_scraper.find_public_procurements_refs_month("02")
        self.requestsMock.get.assert_called_with('http://www.conseildetat.be/?lang=fr&page=lastmonth_02')
        self.assertEqual(REF_LIST, ref_list)

    def test_get_months_all(self):
        self.assertEqual(["01", "02", "03", "04", "05", "06", "07", "08", "09", "10", "11", "12"],
                         self.web_scraper.get_months_order())

    def test_get_months_after06(self):
        self.assertEqual(["06", "07", "08", "09", "10", "11", "12", "01", "02", "03", "04", "05"],
                         self.web_scraper.get_months_order(6))

    def test_get_months_after11(self):
        self.assertEqual(["11", "12", "01", "02", "03", "04", "05", "06", "07", "08", "09", "10"],
                         self.web_scraper.get_months_order(11))


if __name__ == '__main__':
    unittest.main()
